  [],\n\t\"revision_timestamp\": \"2016-02-22T19:55:56.599298\",\n\t\"name\": \"us-amlr-program-zooplankton-dataset\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Zooplankton research in the US AMLR Program
  focuses on the link between prey production, availability, and climate variability
  in relation to predator and fishery demands.  Annual studies include estimates of
  krill abundance, and experiments to develop and enhance hydro-acoustic methodologies.
  \ Long-term objectives include quantifying the inter-annual and decadal mesoscale
  (10's to 100's of kilometers) variability in water mass structure, phytoplankton
  biomass and productivity, and zooplankton (especially krill) associated with potential
  basin scale climate forcing.  Conversely, the microscale (1 to 10's of kilometers)
  features of the distribution and abundance of krill within the foraging range of
  krill predators breeding at Cape Shirreff and Admiralty Bay is also studied to resolve
  local and remote forcing effects on predator foraging success.\",\n\t\"license_title\":
